Title: Bones of Echoes  

Under the distant canopy of frozen stars, the ship Emissary drifted with the silence of whispered shadows into a realm forgotten by time. Here was Promethean, a planet that sparkled before human imaginings like a lantern within the void; an Eden remade to the measures of longing hearts. Yet, as cosmic ocean surrendered to gravity's pull, an edge of alabaster sketched itself upon their sight—an incalculably vast city. A skeletal roseorium rising in spectral majesty, an opulence from which burgeoning dread shone.

Within the command deck, Caelum Mordant watched with unblinking sapphire eyes, dilated by threads of an ancient unease threading willowy fingers across his sense. Likeness to mirage had no bearing here—for through Emissary's translucent view was a world wrinkled into lies etched marble-white against coldly gathering skies. The remains of slumber disrupted tickled his visage, familiarity’s edge as an ephemeral phantom.    

Stepping from molded hatch into earth infused with wistful disquiet, the crew met timeless dust that curled in spiral dance beneath starless heavens now blemished by roaming clouds darker than submerged confidences. Between teeth, granular whispers burrowed on sibilance verdant with esoteric lore savoring secrets-at the touch, it tasted acridly of dissolution borne on piled elements, endured and ancient beneath harsh tryst bravely blinked by lances of scarred luminosity.

Every column, gargoyle, and vault haunted concentrically retreating heights—all filigreed lattices sculpted from skeletal slips gleaming stone white at merciful procession's edge. Fashioned from marrow of forbears long claimed, into spaces honeycombed with airy exhaustion and resounding wind chimes woven of bones.    

