Ava, her eyes a well of unuttered thoughts, squeezed Esther’s shoulder with a kindness rooted in shared history. “More than stone and bone, I suspect,” she replied, the words cloaked in the nostalgic echo of ancient skies they used to marvel at as children. “Home, in some form incomparable perhaps.”

